fun productOfDivisible(nums: List<Int>, m: Int): Int {
    return nums.filter { num -> num % m == 0 }.fold(1) { a, b -> a * b }
}

kotlin.Example2:
fun genRotations(s: String): List<String> {
    return (1 until s.length).map { i -> s.substring(i) + s.substring(0, i) }
}

fun sumOfRotations(s: String): Int {
    return genRotations(s).map { r -> r.toInt() }.sum()
}
